//map 함수 사용할 때 : 박스 별로 키 값을 부여->고유한 값으로 식별 가능
import React from 'react';
import data from "./data/data.json";
import detail from "./data/productDetail.js"
import "./Boxb.css"
import LikeButton from "./LikeButton";

import {Route, Routes} from 'react-router-dom'

import {
    StyledBox,
    TextContainer,
    ProdName,
    ProdAddress,
    ProdPrice,
} from "./styled"


const Boxb = () => {
    return <>{detail.detailProd.map((product)=>(
        <>

            <StyledBox key={product.id}>

                <Routes>
                    <Route 
                    key={product.id}
                    path="/"
                    element={
                        <>
                        <img src={product.img} alt="imag"></img>
                        <ProdName><b>{product.title}</b></ProdName>
                        <ProdAddress className="address"> {product.address}</ProdAddress>
                        <TextContainer>
                            <ProdPrice className="price"> {product.price}</ProdPrice>
                            <LikeButton />
                        </TextContainer>
                        </>
                    }></Route>
                </Routes>



            </StyledBox>
        </>
        ))}
        </>

};

export default Boxb
